  <>
    <Card
    imgsrc={list[0].imgsrc}
    name={list[0].name}
    des={list[0].description}
    /> 
    <Card
    imgsrc={list[1].imgsrc}
    name={list[1].name}
    des={list[1].description}
    /> 
    <Card
     imgsrc={list[2].imgsrc}
     name={list[2].name}
     des={list[2].description}
     /> 
  </>

  );
}
export default App;
